import { Fragment } from 'react'
import { useHistory } from "react-router-dom";

const Experience = () => {
  const history = useHistory()

  const handleChooseExperience = (e) => {
    const experienceType = e.target.id
    history.push(`experience/${experienceType}`)
  }

  return (
    <Fragment>
      <div>
        <h1>Would you like an ...</h1>
        <button onClick={(e) => handleChooseExperience(e)} id='inside'>Inside</button>
        <button onClick={(e) => handleChooseExperience(e)} id='outdoor'>Outdoor</button>
      </div>
    </Fragment>
  )
}

export default Experience
